import React from "react";
import ProductList from './components/dirProductList/ProductList'
function App() {
  const Products = [
    {
        id: 1,
        title: 'book1'
    },
    {
        id: 2,
        title: 'book2'
    },
    {
        id: 3,
        title: 'book3'
    }
]

  return (
    <div>
      <ProductList products={Products}/>

    </div>
  )
}

export default App
